- Nota-se penetração ocasional de material dos horizontes sobreadjacentes no Btx;
- No topo do Btx, ocorre lista irregular de material cinzento-claro (2,5Y 7/2 úmido);
- O mosqueado do Btx referente à cor vermelho-escuro-acinzentada (10YR 3/3 úmido), corresponde às partes com maior concentração de ferro;
- Presença de pontos de cor escura com maior concentração de matéria orgânica no E, EB e BE, sendo em maior quantidade no E.

