- Poucos poros pequenos na camada depositada sobre o perfil; poucos poros pequenos e médios no horizonte Azn1;
- Foi historiado por pessoas da região, que nesta área houve um derramamento de solução salina ligada ao petróleo, que corria num duto sobre o perfil. Este duto permanece muito próximo ao local onde foi descrito e amostrado este perfil;
- Houve deposição de material transportado sobre o perfil, formando uma camada de 40cm. Abaixo deste material há uma camada de piche de 10cm;
- Lençol freático a 88cm;
- Para proceder a descrição e amostragem do perfil, foi necessário esgotar a água do fundo da trincheira com o auxílio de um caminhão vácuo;
- Sobre o perfil, a vegetação foi quase toda extinta;
- Eflorescência de sais no local do perfil;
- Pedregosidade presente na camada de solo depositada sobra o perfil;
- Material acinzentado com estrutura laminar no fundo da trincheira; Foi encontrado calhaus de calcário no material retirado da trincheira.

